import { Link } from "react-router-dom";
import "./Header.css";
import hambugerimg from "https://image.wanted.co.kr/optimize?src=https%3A%2F%2Fstatic.wanted.co.kr%2Fimages%2Fbanners%2F1825%2Fb93ecf4e.jpg&amp;w=1060&amp;q=100";

const Header = (props) => {
  return (
    <div class="header">
      <div class="header_div">
        <div class="header_div_logo">
          <button id="hambuger">
            <img src={props.hambugerimg} alt="햄버거아이콘" />
          </button>
          <Link to="/">
            <i class="icon-logo_new"></i>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Header;
